def formatImage(attribute):
    for image in images:
        if(image["alt"]==attribute):
            return image["src"]
numberProperties = int(input("How many properties? usually 9 or 5"))
data = ""
dataTotal = []
while data!="done": 
    data = input("Data?")
    dataSplit = data.split("\t")
    dataTotal+=dataSplit
counter = 0
dataOutput = []
dataCurrent = []
for data in dataTotal:
    if(data==''):
        continue
    counter+=1
    if(counter == numberProperties):
        dataCurrent.append(data)
        dataOutput.append(dataCurrent)
        dataCurrent = []
        counter = 0
    else:
        dataCurrent.append(data)

allObjects = []
objectProperties = ["image","number","name","typeImage", "type", "starSign","birthday","dice","handSign"]
for objectMain in dataOutput:
    currentObject = {}
    propertyIndex = 0
    for attribute in objectMain:
        if("png" in attribute):
            currentObject[objectProperties[propertyIndex]] = formatImage(attribute)
        else:
            currentObject[objectProperties[propertyIndex]] = attribute
        propertyIndex+=1
    allObjects.append(currentObject)
print(allObjects)
